import React from 'react';

const Projetos = ({ nome, descrição, tecnologias, githubLink, images }) => {
  return (
    <div>
      <h3>{nome}</h3>
      <p>{descrição}</p>
      <p>Tecnologias: {tecnologias}</p>
      <a href={githubLink} target="_blank" rel="noopener noreferrer">Link para o GitHub</a>
      {images && <img src={images} alt="images do projeto" />}
    </div>
  );
}

export default Projetos;
